var { HelloWorld } = require('./HelloWorld.js');

describe("HelloWorld", () => {

  it("should return the imput of a string prop", () => {
      expect(HelloWorld, {greeting: "Hello !! and welcome to my rails-react app !"}).toBe('Hello !! and welcome to my rails-react app !');
  });

});
